import { __decorate } from "tslib";
import { Component } from '@angular/core';
let HomeComponent = class HomeComponent {
    constructor(authService, userService, toastr) {
        this.authService = authService;
        this.userService = userService;
        this.toastr = toastr;
        this.usernick = "";
    }
    ngOnInit() {
    }
    async login() {
        if (this.usernick !== "") {
            await this.userService.createNewUser(this.usernick).then(data => localStorage.setItem("CurrentUsr", data.userId.toString()));
            this.authService.login();
        }
        else {
            this.toastr.error("Put nickname");
        }
    }
    async clickme() {
        await this.userService.createNewUser(this.usernick).then(data => console.log("data from promise", data));
    }
};
HomeComponent = __decorate([
    Component({
        selector: 'app-home',
        templateUrl: './home.component.html',
        styleUrls: ['./home.component.css']
    })
], HomeComponent);
export { HomeComponent };
